column57:
Folkestone and Hythe District Council will be publishing a Concession Notice in July 2024 for a concession contract to supply, install and maintain 48 passenger (bus) shelters across the district.
Your expressions of interest and comments are invited by midday on 28 June 2024.

We will be seeking a single provider for the concession contract with services to include responsive repairs, planned maintenance, and cleaning. The appointed provider will retain ownership of the equipment and have exclusive rights to sell advertising space/airtime to be displayed on the equipment (with some restrictions).

The concession contract term is likely to be 10 years plus 3-5 years. The concession contract will commence in December 2024. The anticipated total value of the concession contract is anticipated to be in excess of £5,500,000 GBP for the maximum 15 years - however, we do not currently have sufficient information to make a proper estimate of the contract value.

We are keen to understand your views on the following:
1. The proposed concession contract term; 
2. The advertising exclusions/restrictions in the draft specification; 
3. The estimated value of a concession contract of this size over a 10-year term (or annually);
4. whether the proposed concession contract is of a scale that could support a financial return or form of profit share to the council;
and 5. the early draft terms of contract.

Please follow the link given below to view the draft documents on proContract and submit your comments.

Wiltshire Police require a Contractor to deliver a complete estate managed service which will include the following design and technical disciplines:

-	Technical support to all estate related, soft and hard facilities management services;
-	Building Surveying services (including Landlord and Tenant and other professional services - i.e. schedules of condition, acquisition surveys and party wall advice);
-	Mechanical and Electrical engineering services;
-	Architectural services;
-	Quantity Surveying / Cost Management advice;
-	Structural and Civil Engineering services;
-	Geo-environmental services;
-	Geo-spatial planning - including topographical 2D and 3D surveys.
-	Energy, environmental and sustainability services (including BREEAM assessors and Decarbonisation surveys and plans);
-	Project Management and Client Adviser / Employers Agent services;
-	Health and Safety Advice;
-	Principal Designer (CDM);
-	Building Regulation Principal Designer;
-	Town and Country Planning service;
-	Legal and Dispute services;
-	PFI adviser and support services (including life cycle fund assessment functions);
-	Traffic and Transport services;
-	Fire Risk Assessment and adviser services;
-	Building Information Modelling (BIM) expertise;
-	Master Planning services; and,
-	Advice on Estates matters in respect of Capital Projects and Major Refurbishments
